import React, { Component } from "react";
import { authService } from "../services/authService";

export default class Dashboard extends Component {
  state = {
    userTemps: [],
  };

  componentDidMount() {
    this.getTemp();
  }

  getTemp() {
    authService.getTemp().then((data) => {
      console.log(data);
      if (data && data.status == 200) {
        this.setState({
          userTemps: data.data,
        });
        // this.props.history.push('temp-dashboard')
      }
      console.log(this.state.userTemps);
    });
  }
  handleFieldChange = (field, value) => {
    const newState = { ...this.state };
    newState.user[field] = value;
    this.setState(newState);
  };

  render() {
    const { temDetails } = this.state.userTemps;
    return (
      <React.Fragment>
        <h2>Login Temperatures</h2>
        <div className="row">
          <button className="btn-success">Hottest First</button>
          <button className="btn-warning">Reset Order</button>
        </div>
        <div className="row">
          <div className="col-6">Country -1</div>
          <div className="col-6">Country -2</div>
        </div>
      </React.Fragment>
    );
  }
}
